import { Box, List, ListItem, ListItemText, Typography } from '@mui/material';
import SearchBar from './SeachBar';

interface Props {
  name: string;
}

const HeaderContent = ({ name }: Props) => {
  return (
    <Box>
      <List className="d-flex align-items-center">
        {name ? (
          <ListItem sx={{ padding: 0, marginLeft: '3px' }}>
            <ListItemText
              sx={{
                maxWidth: '50px',
                span: { fontSize: '14px', fontWeight: 400, fontFamily: 'SVN-Sofia-Regular', display: 'inline-block' },
                color: 'rgb(104, 112, 118)',
              }}
            >
              Gereral
            </ListItemText>
            <span className="mx-2">â€º</span>
            <ListItemText
              sx={{
                maxWidth: '200px',
                span: { fontSize: '14px', fontFamily: 'SVN-Sofia-Regular', display: 'inline-block' },
              }}
            >
              {name}
            </ListItemText>
          </ListItem>
        ) : null}
      </List>
      <Box>
        <Typography
          variant="h3"
          gutterBottom
          sx={{ fontFamily: 'SVN-Sofia-Medium', fontWeight: 500, fontSize: '36px' }}
        >
          {name}
        </Typography>
        <SearchBar />
      </Box>
    </Box>
  );
};

export default HeaderContent;
